import React, { useRef, useState } from 'react';
import Tiptap from './components/Editor';
import Timestamps from './components/Timestamps';
import TextComponent from './components/TextComponent';
import { Person } from './graph/types';
import CallGraph from './graph/CallGraph';

function App() {
  const people: Person[] = [
    { name: "Иван", surname: "Иванов", age: 30, location: "Москва", phone: "123456", outgoing: ["234567"], incoming: ["456789"] },
    { name: "Мария", surname: "Петрова", age: 25, location: "Санкт-Петербург", phone: "234567", outgoing: ["345678"], incoming: ["123456"] },
    { name: "Алексей", surname: "Сидоров", age: 35, location: "Казань", phone: "345678", outgoing: ["456789"], incoming: ["123456"] },
    { name: "Елена", surname: "Козлова", age: 28, location: "Новосибирск", phone: "456789", outgoing: ["123456"], incoming: ["345678"] }
  ];

  return (
    <div className="App" style={{display: 'flex', justifyContent: 'center',}}>
     {/* <Timestamps />
     <Tiptap /> */}
     {/* <TextComponent /> */}
     <CallGraph people={people} />
    </div>
  );
}

export default App;
